import "./App.css";
import { Navbar } from "./Navbar";
import AakashPortrait from "./assets/art/aakash.jpeg";
import Mandalorian from "./assets/art/mandalorian.jpeg";
import Bojack from "./assets/art/bojack.png";
import Fish from "./assets/art/fish.png";
import Japan from "./assets/art/japan.jpeg";
import Owl from "./assets/art/owl.jpeg";
import Lumber from "./assets/art/lumber.jpeg";
import Eclipse from "./assets/art/eclipse.jpeg";

import Bowser from "./assets/art/bowser.jpeg";
import { Footer } from "./Footer";
import { Pill } from "./Pill";
import { HighlightPill } from "./HighlightPill";

export function Art() {
  return (
    <div
      style={{ maxWidth: 450, margin: "0% auto", padding: 16, fontSize: 14 }}
    >
      <Navbar />

      <img
        src={AakashPortrait}
        style={{ width: "100%", borderRadius: 4, marginBottom: 8 }}
      />

      <div
        style={{
          width: "50%",
          border: "solid 1px #333",
          borderRadius: "4px",
          fontSize: 12,
          paddingLeft: 12,
          paddingRight: 12,
          paddingBottom: 12,
          marginRight: 8,
        }}
      >
        <p>
          <Pill
            text="FEATURED PROJECT"
            link="https://opensea.io/collection/pixel-punks-project"
          />
          <HighlightPill
            text="View punks"
            link="https://opensea.io/collection/pixel-punks-project"
          />
        </p>
        Pixel Punks - Making and minting pixelated profile pictures of friends
        and familiars. Message me on Twitter to request one. All available on
        Opensea.
      </div>

      <div style={{ flexDirection: "row", display: "flex", marginBottom: 8 }}>
        <img
          src={Bojack}
          style={{
            width: "49%",
            borderRadius: 4,
            marginRight: 8,
          }}
        />

        <img
          src={Fish}
          style={{
            width: "49%",
            borderRadius: 4,
          }}
        />
      </div>
      <img
        src={Japan}
        style={{ width: "100%", borderRadius: 4, marginBottom: 8 }}
      />
      <img
        src={Eclipse}
        style={{ width: "100%", borderRadius: 4, marginBottom: 8 }}
      />
      <img
        src={Mandalorian}
        style={{ width: "100%", borderRadius: 4, marginBottom: 8 }}
      />
      <img
        src={Owl}
        style={{ width: "100%", borderRadius: 4, marginBottom: 8 }}
      />
      <img
        src={Lumber}
        style={{ width: "100%", borderRadius: 4, marginBottom: 8 }}
      />
      <img
        src={Bowser}
        style={{ width: "100%", borderRadius: 4, marginBottom: 8 }}
      />

      <Footer />
    </div>
  );
}
